import axios from "axios";

const rssService = {
    endpoint: "https://theoldreader.com/profile/VsliderSE47"
}

rssService.feeds = () => {
    const config = {
        method: "GET",
        url: eventsService.endpoint,
        crossdomain: true,
        headers: { "Content-Type": "application/json"}
    }

    return axios(config)
}

export default rssService
